import React from "react";
import { useNavigate } from "react-router-dom";
import { Button, Grid } from "@mui/material";

export const Login = () => {
  const navigate = useNavigate();

  navigate("/login");
  return (
    <Grid container spacing={2}>
      <Grid item xs={2}>
        <Button variant="outlined" fullWidth>
          Pos
        </Button>
      </Grid>
    </Grid>
  );
};
